const ProjectCard = ({ name, imageUrl, description }) => {
  return (
    <div
      key={name}
      className='work-card'
      style={{
        height: '320px',
        width: '420px',
        borderRadius: '25px',
        textAlign: 'center',
        marginLeft: '5%',
        backgroundSize: 'cover',
        backgroundRepeat: 'no-repeat',
        backgroundImage: card.imageUrl,
      }}
    >
      <div>
        <h3>{name}</h3>
        <h4>{description}</h4>
      </div>
    </div>
  );
};

export default ProjectCard;
